import { Component, OnInit } from '@angular/core';
import { Prospecto } from '../../Classes/Prospecto';

@Component({
  selector: 'app-home',
  templateUrl: './captura.component.html',
})
export class CapturaComponent implements OnInit {
  prospectoModel = new Prospecto("", "", "", "", 0, "", 0, "", "", undefined, "");

  constructor() { }

  ngOnInit() { }

  onSubmit() {
    alert("form enviado")
  }
}
<h1>Captura del prospecto</h1>

<form #formularioProspecto="ngForm" (ngSubmit)="onSubmit()">
  <input type="text" name="nombre" placeholder="Nombre del prospecto" [(ngModel)]="prospectoModel.nombre" required>
  <br><br>
  <input type="text" name="apellidoPaterno" placeholder="Primer apellido" [(ngModel)]="prospectoModel.apellidoPaterno" required>
  <br><br>
  <input type="text" name="apellidoMaterno" placeholder="Segundo apellido" [(ngModel)]="prospectoModel.apellidoMaterno">
  <br><br>
  <input type="text" name="calle" placeholder="Calle" [(ngModel)]="prospectoModel.calle" required>
  <br><br>
  <input type="number" name="numero" placeholder="Numero" [(ngModel)]="prospectoModel.numero" required>
  <br><br>
  <input type="text" name="colonia" placeholder="Colonia" [(ngModel)]="prospectoModel.colonia" required>
  <br><br>
  <input type="number" name="codigoPostal" placeholder="Codigo postal" [(ngModel)]="prospectoModel.codigoPostal" required>
  <br><br>
  <input type="text" name="telefono" placeholder="Telefono" [(ngModel)]="prospectoModel.telefono" required>
  <br><br>
  <input type="text" name="rfc" placeholder="RFC" [(ngModel)]="prospectoModel.rfc" required>
  <br><br>
  <button type="submit">Guardar</button>
</form>

<h2>Depurando prospecto:</h2>
{{ prospectoModel | json }}
